import React, { Fragment } from 'react';
import Logo from './components/Image/Logo.png';

function FrontPage() {
    const Main_div = {
        width: '100%',
        height:'100vh',
        background:'#000',
        display:'grid',
        placeItems:'center'
      }
      const center_div = {
          width:'15rem',
          height:'15rem',
          background:'#eee',
        //   position:' relative'
      }
      const img = {
          width:'15rem',
          height:'15rem',
        //   position:' absolute'
      }
      const rotate = {
          width: '15rem',
          height:'15rem'
      }
    return (
        <Fragment>
            <div style={Main_div}>
                <div style={center_div}>
                    <div style={rotate}></div>
                    <img src={Logo} alt="" style={img} />
                </div>
            </div>
        </Fragment>
    )
}

export default FrontPage;
